import Viewuser from './components/viewuser/viewuser';

function App() {
  return (
    <UserDataProvider>
      <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home />}/>
            <Route path="/view-user/:id" element={<Viewuser />}/>
            <Route path="/delete-user/:id" element={<Delete />}/>
          </Routes>
      </BrowserRouter>
    </UserDataProvider>

  );
}

export default App;
